/* eslint-disable react/no-unescaped-entities */
import React, { Component } from "react"
import {
  Background,
  Wrapper,
  Title,
  InputBox,
  Button,
} from "./styles/forgotPassword"

class ResetPassword extends Component {
  render() {
    return (
      <Background>
        <Wrapper>
          <Title>Email</Title>
          <InputBox type="email" />
          <Button>Next</Button>
        </Wrapper>
      </Background>
    )
  }
}

export default ResetPassword
